import React from 'react';
import { useNavigate } from 'react-router-dom';
// image logo
const logo = 'https://images.squarespace-cdn.com/content/v1/5de7be825321a1256af4048a/1665833573454-FPP4JCI5QMBVAJU0MTTI/st-michael-cinema.jpg?format=500w';

// starting screen
export default function StartScreen() {
  let navigate = useNavigate();

  return (
    <div style={styles.Setup}>
      <img src={logo} alt="Logo" style={{ width: '400px', height: '225px' }} />
      <div style={{ overflowY: 'scroll' }}>
        <title style={styles.TitleText}>
          Book your Party
        </title>
        <div style={styles.SelectionView}>
          <h2 style={styles.HeaderText}>Party Room</h2>
          <p>
            5 minutes - packages start at $210
            <br /> St. Michael Cinema
            <br /> 1st Floor Party Room
            <br /> Capacity: 15
          </p>
          <button style={styles.Buttons} onClick={() => navigate('/Information')}>
            Book this Room
          </button>
        </div>
        <div style={styles.SelectionView}>
          <h2 style={styles.HeaderText}>Dining Room</h2>
          <p>
            5 minutes - packages start at $210
            <br /> St. Michael Cinema
            <br /> 2nd Floor Dining Room
            <br /> Capacity: 25
          </p>
          <button style={styles.Buttons} onClick={() => navigate('/Information')}>
            Book this Room
          </button>
        </div>
        <button style={styles.Buttons} onClick={() => navigate('/SpecialBooking')}>
          Request a special booking?
        </button>
        <button style={styles.Buttons} onClick={() => navigate('/AdminVerifyScreen')}>
          Admin: manage bookings
        </button>
      </div>
    </div>
  );
}

// Styles
const styles = {
  Setup: {
    backgroundColor: 'white',
    alignItems: 'center',
    display: 'flex',
    flexDirection: 'column',
    padding: '20px',
  },
  Buttons: {
    backgroundColor: 'orange',
    margin: '10px',
    padding: '10px',
    border: 'none',
    cursor: 'pointer',
  },
  ButtonText: {
    textAlign: 'center',
  },
  SpecialButton: {
    textAlign: 'center',
    fontSize: '15px',
  },
  SelectionView: {
    border: '4px solid black',
    padding: '5px',
    paddingBottom: '10px',
    margin: '10px',
  },
  HeaderText: {
    fontWeight: 'bold',
    fontSize: '25px',
  },
  TitleText: {
    fontSize: '40px',
    paddingBottom: '50px',
    color: 'grey',
    textAlign: 'center',
  },
};
